import React from "react";
import Meal from "./Meal";

export default function MealList({ mealData }) {
  const nutrients = mealData.nutrients;

  return (
    <main className="main-card">
    
      <section className="nutrients">
        <h1>Your Meal Plan!ü•ó</h1>
        <ul>
          <li>Caloriesü•ì: {nutrients.calories.toFixed(0)} |</li>
          <li>Carbohydratesüçû: {nutrients.carbohydrates.toFixed(0)} |</li>
          <li>Fatüçï: {nutrients.fat.toFixed(0)} |</li>
          <li>Proteinüç≥: {nutrients.protein.toFixed(0)} </li>
        </ul>
      </section>
      <section className="meals">
        {mealData.meals.map((meal) => {
          return <Meal key={meal.id} meal={meal} />;
        })}
      </section>
    </main>
  );
}
